Matching one of two fields with $in and $elemMatch<p>Combining $in and $elemMatch</p>

<p>I'm trying to find a partial match for an employee's first or last name. I tried using the $or operator, but Mongo doesn't seem to recognize it.</p>

<p>Where am I going wrong?</p>

<pre><code>router.get('/employees', async (req, res, next) =&gt; {
  if(req.query.name) {
    const response = await Companies.find({ employees: 
      {
        $elemMatch: {
          $in: [
            { first_name:new RegExp(req.query.name, 'i') },
            { last_name:new RegExp(req.query.name, 'i') }
          ]
        }
      }
    })
    res.json({ response })
  }
  else { next() }
})
</code></pre>

<p>My schema looks like this:</p>

<pre><code>const companies = new mongoose.Schema({
    company: [{
        name: { type:String, required:true },
        contact_email: { type:String, required:true },
        employees: [{ 
            first_name:String,
            last_name:String,
            preferred_name:String,
            position: { type:String },
            birthday: { type:Date },
            email: { type:String },
         }],
    }]
}, {
    timestamps: { createdAt: 'created_at', updatedAt: 'updated_at' }
})
</code></pre>

<p>I have some names in there that should match (including just "nna"),  but sending a get request to /employees?name=nna just returns an empty response array.</p>

